import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for any sort/filter controls by label text
    await page.waitForSelector('label[for="sortSelect"]', { timeout: 5000 });

    // Use the label to find the select element (robust to class/id changes)
    const sortLabel = await page.$('label[for="sortSelect"]');
    const sortSelectId = await sortLabel.getAttribute('for');
    const sortSelect = await page.$(`#${sortSelectId}`);

    // Open the sort dropdown
    await sortSelect.focus();

    // Take screenshot before selecting
    const beforeSortShot = path.join(screenshotsDir, 'step_2_before_sort.png');
    await page.screenshot({ path: beforeSortShot });
    screenshots.push(beforeSortShot);

    // Select "Price: Low to High" (option value is "price-low")
    await sortSelect.selectOption('price-low');

    // Wait for the product grid/list to update (wait for any product card to re-render)
    await page.waitForSelector('.product-card, .product-card-list', { timeout: 5000 });

    // Take screenshot after applying price sort
    const afterSortShot = path.join(screenshotsDir, 'step_3_after_sort.png');
    await page.screenshot({ path: afterSortShot });
    screenshots.push(afterSortShot);

    // Extract the first 3 product titles and prices to verify sorting
    const productCards = await page.$$('.product-card, .product-card-list');
    const extractedData = { products: [] };
    for (let i = 0; i < Math.min(3, productCards.length); i++) {
      const card = productCards[i];
      const title = await card.$eval('.product-title', el => el.textContent.trim());
      const price = await card.$eval('.product-price', el => el.textContent.replace(/[^0-9.]/g, '').trim());
      extractedData.products.push({ title, price });
    }

    return {
      success: true,
      action: "Applied Price: Low to High sort filter and extracted top product data",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
